import React from "react";
import {Link} from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Img3 from '../img/service_3.jpg';


const useStyles = makeStyles({
  root: {
    color: "#383e56",
    maxWidth: 345,
    marginLeft: "auto",
    marginRight: "auto",
    marginTop: "2em"
  },
  media: {
    height: 300,
  },
  buttonStyle: {
    color: "#d4b5b0",
  },
  textStyle: {
    color: "rgba(56, 62, 86, 1)",
    '&:hover': {
      color: "#d4b5b0",
    },
  },
  headerStyle: {
    color: "#383e56",
    '&:hover': {
      color: "rgba(56, 62, 86, 0.9)",
    },
  },
});

function CardComponent3() {

  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <CardActionArea>
        <Link to="/leistung3">
          <CardMedia
            className={classes.media}
            image={Img3}
            title="Geburtsvorbereitung"
          />
        </Link>
        <Link to="/leistung1">
          <CardContent>
            <Typography gutterBottom variant="h5" component="h2">
              <Link to="/leistung3" className={classes.headerStyle}>
                Geburtsvorbereitung
              </Link>
            </Typography>
            <Typography variant="body2" color="textSecondary" component="p">
              Ich begleite Sie vor der Geburt, w√§hrend der Geburt und... Peace das Baby ist raus.
            </Typography>
          </CardContent>
        </Link>
      </CardActionArea>
      <CardActions>
        <Link to="/leistung1">
          <Button size="small">
            <Link className={classes.textStyle} to="/leistung3">Mehr Infos</Link>
          </Button>
        </Link>
      </CardActions>
    </Card>
  );
}

export default CardComponent3;
